}));

function HomeSection() {
  const classes = useStyles();
  return (
    <div className={classes.root}>
      <Card>
        <CardMedia
          className={classes.cover}
          component="img"
          image={result.media.image_url_thumb || bike}
        ></CardMedia>
        <CardContent></CardContent>
      </Card>
    </div>
  );
}

export default HomeSection;
